import './Tab1.css'
import * as React from 'react';
import Autocomplete from '@mui/material/Autocomplete';
import TextField from '@mui/material/TextField';
import Checkbox from '@mui/material/Checkbox';
import Button from '@mui/material/Button';
import CheckBoxOutlineBlankIcon from '@mui/icons-material/CheckBoxOutlineBlank';
import CheckBoxIcon from '@mui/icons-material/CheckBox';
import Table from '../../components/table/table';
import {useNavigate} from 'react-router-dom';

const icon = <CheckBoxOutlineBlankIcon fontSize="small" />;
const checkedIcon = <CheckBoxIcon fontSize="small" />;

export default function Tab1() {
  const main = ['Main Ranking 1','Main Ranking 2'];
  const add = ['Additional Ranking 1', 'Additional Ranking 2'];
  const states = [
    'Alabama',
    'Alaska',
    'Arizona',
    'Arkansas',
    'California',
    'Colorado',
    'Connecticut',
    'Delaware',
    'Florida',
    'Georgia',
    'Hawaii',
    'Idaho',
    'Illinois',
    'Indiana',
    'Iowa',
    'Kansas',
    'Kentucky',
    'Louisiana',
    'Maine',
    'Maryland',
    'Massachusetts',
    'Michigan',
    'Minnesota',
    'Mississippi',
    'Missouri',
    'Montana',
    'Nebraska',
    'Nevada',
    'New Hampshire',
    'New Jersey',
    'New Mexico',
    'New York',
    'North Carolina',
    'North Dakota',
    'Ohio',
    'Oklahoma',
    'Oregon',
    'Pennsylvania',
    'Rhode Island',
    'South Carolina',
    'South Dakota',
    'Tennessee',
    'Texas',
    'Utah',
    'Vermont',
    'Virginia',
    'Washington',
    'West Virginia',
    'Wisconsin',
    'Wyoming',
    'Puerto Rico',
  ];

  const navigate = useNavigate()
  const [mainRanking,setMainRanking] = React.useState('')
  const [additionalRanking,setAdditionalRanking] = React.useState('')
  const [weight,setWeight] = React.useState(-1)

  return (
    <section id = "tab1">
      <h1>Welcome to Tab 1.</h1> 
      <div className='box'>
        <div className ='ranking'>
          <div className='filter-header'>Select your Ranking</div>
          <Autocomplete
            disablePortal
            id="combo-box-demo"
            className='tab'
            options={main}
            sx={{ width: 550 }}
            renderInput={(params) => <TextField {...params} label="Choose Main Ranking" />}
            onChange = {e => setMainRanking(e.target.innerHTML)}
          />
          <Autocomplete
            disablePortal
            id="combo-box-demo"
            className = 'tab'
            options={add}
            sx={{ width: 550 }}
            renderInput={(params) => <TextField {...params} label="Choose Additional Ranking (Optional)" />}
            onChange = {e => setAdditionalRanking(e.target.innerHTML)}
          />
          <TextField id="outlined-basic" label="Weight (0 to 1)" sx={{ width: 550 }} variant="outlined"
            onChange = {e => setWeight(parseFloat(e.target.value))} />
          <br></br>
          <Button variant="contained"sx={{ width: 550 }}
            onClick = {() => {
              if (mainRanking === '') {
                alert('Please Choose Main Ranking')
                return
              }
              if (weight < 0 || weight > 1){
                alert('Please provide appropriate weight')
                return
              }
              const currentUser = JSON.parse(window.localStorage.getItem("data"))
              currentUser.push({
                main : mainRanking,
                add : additionalRanking,
                weight : weight
              })
              window.localStorage.setItem("data", JSON.stringify(currentUser))
              window.location.reload()
            }}>
              Add
            </Button>
        </div>
        <div className ='filter'>
          <div className = 'filter-header'>Filter Options</div>
          <Autocomplete
              multiple
              id="checkboxes-tags-demo"
              options={['Urban','Suburban','Rural']}
              disableCloseOnSelect
              getOptionLabel={(option) => option}
              renderOption={(props, option, { selected }) => {
                return (
                <li {...props}>
                  <Checkbox
                    icon={icon}
                    checkedIcon={checkedIcon}
                    style={{ marginRight: 8 }}
                    checked={selected}
                    onChange = {e => console.log(e)}
                  />
                  {option}
                </li>
              )}}
              style={{ width: 500 }}
              className = 'tab'
              renderInput={(params) => (
                <TextField {...params} label="Setting" placeholder="Setting" 
                />
              )}
            />
          <Autocomplete
              multiple
              id="checkboxes-tags-demo"
              options={['Private','Public']}
              disableCloseOnSelect
              getOptionLabel={(option) => option}
              renderOption={(props, option, { selected }) => (
                <li {...props}>
                  <Checkbox
                    icon={icon}
                    checkedIcon={checkedIcon}
                    style={{ marginRight: 8 }}
                    checked={selected}
                  />
                  {option}
                </li>
              )}
              style={{ width: 500 }}
              className = 'tab'
              renderInput={(params) => (
                <TextField {...params} label="Private/Public" placeholder="Private/Public" />
              )}
            />
            <Autocomplete
              multiple
              id="checkboxes-tags-demo"
              options={states}
              disableCloseOnSelect
              getOptionLabel={(option) => option}
              renderOption={(props, option, { selected }) => (
                <li {...props}>
                  <Checkbox
                    icon={icon}
                    checkedIcon={checkedIcon}
                    style={{ marginRight: 8 }}
                    checked={selected}
                  />
                  {option}
                </li>
              )}
              style={{ width: 500 }}
              className = 'tab'
              renderInput={(params) => (
                <TextField {...params} label="Location" placeholder="Location" />
              )}
            />
        </div>
      </div>
      <div className = 'search'>
        <Button variant="contained"sx={{ width: 300 }} onClick = {() => navigate('../Tab3',{relative: "path"})}>Search</Button>
      </div>
      <Table></Table>
    </section>
  );
}
